Store cookies You can update your client to enable or disable the cookie store with store_cookies: // If an http response contains `Set-Cookie` headers, then cookies will be saved for
// subsequent http requests.
let grillon = Grillon::new("https://server.com/")?.store_cookies(true)?; grillon.post("auth").assert().await.headers(contains(vec![( SET_COOKIE, HeaderValue::from_static("SESSIONID=123; HttpOnly"),
)])); grillon .get("authenticated/endpoint") // An endpoint where the session cookie `SESSIONID=123` is required. .assert() .await .status(is_success()); The cookie store is disabled by default. Basic Auth You can easily configure your headers with the basic_auth function to set a per-request authentication: Grillon::new("https://server.com/")? .get("auth/basic/endpoint") .basic_auth("isaac", Some("rayne")) .assert() .await .status(is_success()); Note that the header is considered as sensitive and will not be logged. Bearer token You can also use the bearer_auth function to set your Bearer header per-request: Grillon::new("https://server.com/")? .get("auth/bearer/endpoint") .bearer_auth("token-123") .assert() .await .status(is_success()); This header is also considered as sensitive and will not be logged.

