When you want to use a different client to send your requests and handle the responses, you should use the internal http response representation to assert. For that you need to use the Assert structure. For example, suppose you want to use reqwest to perform an http GET request and you want to assert that the response time is less than 400ms. First you need to create your own structure that will handle a reqwest::Response. struct MyResponse { pub response: reqwest::Response,
} Next, you need to implement the grillon::Response trait to describe how you handle the various pieces of information that Grillon needs to perform assertions: #[async_trait(?Send)]
impl Response for MyResponse { fn status(&self) -> StatusCode { self.response.status() } async fn json(self) -> Option<Value> { self.response.json::<Value>().await.ok() } fn headers(&self) -> HeaderMap { self.response.headers().clone() }
} The next step is to create a new Assert instance which requires: An implementation of a grillon::Response, the response time in milliseconds, and the LogSettings for the assertion results. Let's first run the request and get the execution time: let now = Instant::now();
let response = reqwest::get(mock_server.server.url("/users/1")) .await .expect("Failed to send the http request");
let response_time = now.elapsed().as_millis() as u64; Now let's pass the response to your own response structure: let my_response = MyResponse { response }; You are now ready to assert against a reqwest::Response wrapped by your own implementation of a grillon::Response: Assert::new(my_response, response_time, LogSettings::default()) .await .response_time(is_less_than(400));

