With Grillon, you can easily chain calls to configure and send HTTP requests and reuse the same client for a given base api URL. #[tokio::test]
async fn test_get_jsonplaceholder() -> Result<()> { let grillon = Grillon::new("https://jsonplaceholder.typicode.com")?; grillon .get("posts?id=1") .assert() .await .json_path("$[0].id", is(json!(1))); grillon .get("posts?id=2") .assert() .await .json_path("$[0].id", is(json!(2))); Ok(())
}

