Grillon supports two different types to configuring http request headers: HeaderMap Vec<(HeaderName, HeaderValue)> let grillon = Grillon::new("https://jsonplaceholder.typicode.com")?; // Vec<(HeaderName, HeaderValue)>
let request = grillon .post("posts") .payload(json!({ "title": "foo", "body": "bar", "userId": 1 })) .headers(vec![( CONTENT_TYPE, HeaderValue::from_static("application/json"), )]); // Override with HeaderMap
let mut header_map = HeaderMap::new();
header_map.insert(CONTENT_TYPE, HeaderValue::from_static("application/json"));
let request = request.headers(header_map);

