Json path requires one more argument than other predicates because you have to provide a path. The expected value should always be a valid json representation. To enforce this the provided value is always converted to a Value. Here is an example of a json path assertion, where we are testing the value under the path $[0].id. #[tokio::test]
async fn test_json_path() -> Result<()> { Grillon::new("https://jsonplaceholder.typicode.com")? .get("posts?id=1") .assert() .await .json_path("$[0].id", is(json!(1))) .json_path("$[0].id", is("1")); Ok(())
}

