Create a new create_posts.rs file in tests and copy/paste the following example: use grillon::{dsl::*, dsl::http::*, json, Grillon, StatusCode, Result};
use grillon::header::{HeaderValue, CONTENT_LENGTH, CONTENT_TYPE};
use grillon::Assert; #[tokio::test]
async fn end_to_end_test() -> Result<()> { Grillon::new("https://jsonplaceholder.typicode.com")? .post("posts") .payload(json!({ "title": "foo", "body": "bar", "userId": 1 })) .assert() .await .status(is_success()) .status(is(201)) .response_time(is_less_than(700)) .json_body(is(json!({ "id": 101, }))) .json_body(schema(json!({ "properties": { "id": { "type": "number" } } }))) .json_path("$.id", is(json!(101))) .header(CONTENT_TYPE, is("application/json; charset=utf-8")) .headers(contains(vec![ ( CONTENT_TYPE, HeaderValue::from_static("application/json; charset=utf-8"), ), (CONTENT_LENGTH, HeaderValue::from_static("15")), ])) .assert_fn(|assert| { let Assert { headers, status, json, .. } = assert.clone(); assert!(!headers.unwrap().is_empty()); assert!(status.unwrap() == StatusCode::CREATED); assert!(json.is_some()); println!("Json response : {:#?}", assert.json); }); Ok(())
}
